DROP TABLE IF EXISTS sample_table;

CREATE TABLE sample_table (
	id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	name TEXT NOT NULL
) ENGINE InnoDB CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;



DROP TABLE IF EXISTS users_data;
CREATE TABLE `users_data` (
  `user_id` varchar(24) COLLATE utf8mb4_general_ci NOT NULL,
  `user_password` varchar(256) COLLATE utf8mb4_general_ci NOT NULL,
  `user_name` varchar(32) COLLATE utf8mb4_general_ci NOT NULL,
  `user_sex` int NOT NULL,
  `user_address` varchar(128) COLLATE utf8mb4_general_ci NOT NULL,
  `user_tel` varchar(16) COLLATE utf8mb4_general_ci NOT NULL,
  `user_mail_address` varchar(64) COLLATE utf8mb4_general_ci NOT NULL,
  `user_mobile_device` int NOT NULL
);



DROP TABLE IF EXISTS dummies_data;
CREATE TABLE `dummies_data` (
  `user_id` varchar(24) UNIQUE COLLATE utf8mb4_general_ci NOT NULL,
  `user_password` varchar(256) COLLATE utf8mb4_general_ci NOT NULL,
  `user_name` varchar(32) COLLATE utf8mb4_general_ci NOT NULL,
  `user_sex` int NOT NULL,
  `user_address` varchar(128) COLLATE utf8mb4_general_ci NOT NULL,
  `user_tel` varchar(16) COLLATE utf8mb4_general_ci NOT NULL,
  `user_mail_address` varchar(64) COLLATE utf8mb4_general_ci NOT NULL,
  `user_mobile_device` int NOT NULL
);

